import React from "react";
import Navbar from "./Navbar";
import "./Home.css";

const Home = () => {
  return (
    <div>
      <Navbar />
      <div className="home-container">
        <header className="hero-section">
          <h1>Welcome to Velava Super Stores</h1>
          <p>Your one-stop shop for all your grocery and household needs.</p>
          <button className="shop-now">Shop Now</button>
        </header>
        <section className="features">
          <div className="feature-box">
            <h3>Quality Products</h3>
            <p>We ensure the best quality products at affordable prices.</p>
          </div>
          <div className="feature-box">
            <h3>Fast Delivery</h3>
            <p>Get your essentials delivered to your doorstep quickly.</p>
          </div>
          <div className="feature-box">
            <h3>Customer Satisfaction</h3>
            <p>Your satisfaction is our top priority.</p>
          </div>
        </section>
      </div>
    </div>
  );
};

export default Home;
